import {Component} from '@angular/core';
import {MatToolbar} from "@angular/material/toolbar";
import {MatIcon} from "@angular/material/icon";
import {MatButton, MatIconButton} from "@angular/material/button";
import {LanguageSwitcherComponent} from "../../components/language-switcher/language-switcher.component";
import {MatMenu, MatMenuTrigger} from "@angular/material/menu";
import {MatCard, MatCardTitle} from "@angular/material/card";
import {
  FormBuilder,
  FormGroup,
  FormsModule,
  ReactiveFormsModule,
  Validators
} from "@angular/forms";
import {MatFormField, MatFormFieldModule} from "@angular/material/form-field";
import {MatCheckbox} from "@angular/material/checkbox";
import {MatInput, MatInputModule} from "@angular/material/input";
import {MatSelectModule} from "@angular/material/select";
import {Router} from "@angular/router";
import {MatRadioButton, MatRadioGroup} from "@angular/material/radio";
import {NgIf} from "@angular/common";
import { upcEmailValidator } from './upcEmailValidator';
import {TranslateModule} from "@ngx-translate/core";
import {RegisterService} from "../../services/register.service";

@Component({
  selector: 'app-register',
  standalone: true,
  imports: [
    MatToolbar,
    MatIcon,
    MatIconButton,
    MatButton,
    LanguageSwitcherComponent,
    MatMenu,
    MatMenuTrigger,
    MatCard,
    MatCardTitle,
    FormsModule,
    MatFormField,
    MatCheckbox,
    MatInput,
    MatFormFieldModule, MatInputModule, MatSelectModule, MatRadioGroup, MatRadioButton, ReactiveFormsModule, NgIf, TranslateModule
  ],
  templateUrl: './register.component.html',
  styleUrl: './register.component.css'
})
export class RegisterComponent {

  /**
   * @property registerForm {FormGroup}
   * @description The reactive form group for user registration data.
   */
  registerForm: FormGroup;

  /**
   * @property isTutor {boolean}
   * @description Flag indicating whether the selected role is "teacher".
   * @property isStudent {boolean}
   * @description Flag indicating whether the selected role is "student".
   */
  isTutor: boolean = false;
  isStudent: boolean = false;

  /**
   * @private tutorId: number
   * @description A counter used to generate unique tutor IDs.
   */
  private tutorId: number = 1;

  /**
   * @constructor
   * @param {FormBuilder} fb - An instance of FormBuilder for creating form groups.
   * @param {Router} router - An instance of Router for navigation.
   * @param {RegisterService} registerService - An instance of RegisterService for user registration and role management.
   */
  constructor(
    private fb: FormBuilder,
    private router: Router,
    private registerService: RegisterService
  ) {
    this.registerForm = this.fb.group({
      firstName: ['', Validators.required],
      lastName: ['', Validators.required],
      gender: ['', Validators.required],
      semester: ['', Validators.required],
      email: ['', [Validators.required, Validators.email, upcEmailValidator]],
      password: ['', Validators.required],
      roleType: ['', Validators.required]
    });
    this.initializeTutorId();
  }

  /**
   * @method private initializeTutorId
   * @description
   * Initializes the `tutorId` by retrieving the list of existing tutors from the server
   * and calculating the next available `tutorId`. The highest `tutorId` is determined,
   * and the next tutor will be assigned the subsequent `tutorId`.
   * If no tutors exist, the `tutorId` starts from 1.
   */
  private initializeTutorId(): void {
    this.registerService.getTutors().subscribe({
      next: (tutors) => {
        if (tutors.length > 0) {
          const maxId = Math.max(...tutors.map(tutor => tutor.tutorId));
          this.tutorId = maxId + 1;
        }
      },
      error: (error) => {
        console.error('Error getting tutors:', error);
      }
    });
  }

  /**
   * @method onRoleChange
   * @description Handles the change event for the role selection dropdown.
   * @param {any} event - The change event object.
   */
  onRoleChange(event: any) {
    const selectedRole = event.value;
    this.isTutor = selectedRole === 'teacher';
    this.isStudent = selectedRole === 'student';
  }

  /**
   * @method onSignUp
   * @description Handles the form submission for user registration.
   */
  onSignUp() {
    if (this.registerForm.valid) {
      const formValues = this.registerForm.value;
      this.registerService.setUserRole(formValues.roleType);

      let userToRegister: any = {
        ...formValues,
        avatarUrl: 'data:image/png;base64,',
      };

      if (formValues.roleType === 'teacher') {
        userToRegister.tutorId = this.tutorId;
        sessionStorage.setItem('pendingTutor', JSON.stringify(userToRegister));
        this.router.navigate(['Plans']).then();
      } else if (formValues.roleType === 'student') {
        userToRegister.tutorId = null;
        this.registerService.registerUser(userToRegister).subscribe({
          next: (response) => {
            console.log('User registered successfully:', response);
            localStorage.setItem('currentUser', JSON.stringify(response));
            this.router.navigate(['Dashboard']).then();
          },
          error: (error) => {
            console.error('Error registering user:', error);
          }
        });
      }
    } else {
      console.log('Invalid form');
    }
  }

  /**
   * @method onLogin
   * @description Navigates to the login route.
   */
  onLogin() {
    this.router.navigate(['LogIn']).then();
  }
}
